import React, { useState, useEffect } from "react";
import { Row, Container, Col, InputGroup } from "react-bootstrap";
import Structure from "../../Component/Structure";
import DependenciasRurales from "./DependenciasRurales";
import CardFigure from "../../Component/CardFigureCreator";

export default function Creador(props) {
  const [value, setValue] = useState("");
  const options = [
    { value: 'flavor', label: 'flavor' },
    { value: 'yummy', label: 'yummy' },
    { value: 'red', label: 'red' },
    { value: 'green', label: 'green' },
    { value: 'yellow', label: 'yellow' },
];

  return (
    <Structure>
      <div className="content-header">
        <div className="container-fluid">
          <div className="row mb-2 text-center">
            <div className="col-sm-12">
              <h1 className="m-0"> Creador de graficos </h1>
            </div>

            {/* /.col */}
          </div>
          {/* /.row */}
        </div>
        {/* /.container-fluid */}
      </div>
      <Container fluid>
        <Row>
          <Col lg={3}>
            <InputGroup>
              <label>Ingresa una variable</label>
              <select>
                <option value="grapefruit">Grapefruit</option>
                <option value="lime">Lime</option>
                <option selected value="coconut">
                  Coconut
                </option>
                <option value="mango">Mango</option>
              </select>
            </InputGroup>
          </Col>
          <Col lg={9}>
            <CardFigure nombre={value} icono={"fas fa-chart-bar mr-1"}>
              <DependenciasRurales value={value}></DependenciasRurales>
            </CardFigure>
          </Col>
        </Row>
      </Container>
    </Structure>
  );
}
